import React, {Component} from 'react';
import {Table} from 'react-bootstrap'; 
import './tourneycss.css';

export class UmpireInfo extends Component {

    constructor(props) {
        super(props);
        this.state ={umpires:[]}
    }

    componentDidMount() {
        this.refreshList(); 
    }
    refreshList() {
        this.setState({
            umpires:[{"TournamentID":1, "TeamName": "Muth Black", "TeamAgeGroup": "14U", "TeamContact": "Jae Shobbrook","TeamPhoneContact": "(989) 529-3545", "TeamEmailContact": "muthblackcoach14U@gmail.com"}, 
            {"TournamentID":1, "TeamName": "Muth Red", "TeamAgeGroup": "15U", "TeamContact": "Brad Walraven", "TeamPhoneContact": "(616) 555-3345", "TeamEmailContact": "muthredroach15U@gmail.com"},
            {"TournamentID":2, "TeamName": "Mavs Blue", "TeamAgeGroup": "16U", "TeamContact": "Matt Karwat", "TeamPhoneContact": "(801) 262-8026", "TeamEmailContact": "mavbluecoach16U@gmail.com"},
            {"TournamentID":2, "TeamName": "Mavs White", "TeamAgeGroup": "12U", "TeamContact": "Noah Bowers", "TeamPhoneContact": "(248) 589-0022", "TeamEmailContact": "mavbluecoach12U@gmail.com"}
        ]
        })
    }
    render(){

    const {umpires} = this.state; 

        return(
            <div>
            <h2>Umpire Information</h2>

           <Table className="mt-4" stripped bordered hover size="sm">
               <thead>
                    <tr>
                        <th>Tournament ID</th>
                        <th>Team Name</th>
                        <th>Team Age Group</th>
                        <th>Team Contact</th>
                        <th>Team Phone Contact</th>
                        <th>Team Email Contact</th>
                    </tr>
               </thead>

               <tbody>
                   {umpires.map(umpire=> 
                        <tr key = {umpire.TournamentID}> 
                            <td>{umpire.TournamentID}</td>
                            <td>{umpireTeamName}</td>
                            <td>{umpire.TeamAgeGroup}</td>
                            <td>{umpire.TeamContact}</td>
                            <td>{umpire.TeamPhoneContact}</td>
                            <td>{umpireTeamEmailContact}</td>
                        </tr>
                        )}
               </tbody>

           </Table>

           </div>
        )


    }
}
